import React from 'react';
import { Link } from 'react-router-dom';

import './navbar.css';

const NavBar = () => {
  return (
    <div>
      <h5>NAVBAR</h5>
      <ul>
        
        <li><a href="/Details">Home</a></li>
        <li><a href="/Vitals">About</a></li>
     	</ul>
      <hr />
    </div>
  );
};

export {NavBar};
